  /></p><p><a href=\"https://logis.loudoun.gov/metadata/Stormwater%20pipes.html\"
  target=\"_blank\">More Metadate</a>u00a0<br /></p><p>Abstract: Loudoun County u2013
  Storm Water Infrastructure The stormwater data is comprised of arcs/lines (pipes
  and culverts) and points (inlets, manholes, pipe ends, ponds and control devices).
  The pipes and culverts are the man-made structures composed of concrete, metal and
  plastic used to convey storm water from catch basins and ponds to the natural drainage
  ways and swales that eventually discharge to creeks and streams. The point structures,
  typically one at the end of each line, include the storm water infrastructure where
  there is a change in pipe direction. The data are collected primarily in eastern
  Loudoun in the more urbanized portions of the County. The data were collected in
  the field using GPS so that at least 95% of data is accurate to less than 1 meter.</p>\",\n\t\"license_title\":
